import React from 'react';
import bg_dash from "../images/dashboard@2x.png";
import {BrowserRouter as Router , Switch , Route,Link } from 'react-router-dom';

export default function Test() {
    const Std =[
        {
            id:1,
            name:"Carole Chimako",
            class:"class",
            image:bg_dash
        },
        {
            id:2,
            name:"Chloé Modibo",
            class:"class",
            image:bg_dash
        },
        {
            id:3,
            name:"Diego Morata",
            class:"class",
            image:bg_dash
        },
        {
            id:4,
            name:"Grigoriy Kozhukhov",
            class:"class",
            image:bg_dash
        },
        {
            id:5,
            name:"Laura Sofía Ureña",
            class:"class",
            image:bg_dash
        },
        {
            id:6,
            name:"María Paula Morterero",
            class:"class",
            image:bg_dash
        },
        {
            id:7,
            name:"Núria Moura",
            class:"class",
            image:bg_dash
        },
        {
            id:8,
            name:"Sofía Alcocer",
            class:"class",
            image:bg_dash
        }
    ]
    return (
        <div>
        <div className="students-container">
            {/* <div className="filter">
                <div className="search-box">
                    <div className="search-box-text">Select Class</div>
                    <div className="search-box-icon"></div>
                </div>
            </div> */}
            {Std.map(student =>{
                return(
                    <div className="student">
                        <div className="student-image" style={{backgroundImage:"url(" + student.image + ")"}}></div>
                        <div className="student-infos">
                            <div className="student-name">{student.name}</div>
                            <div className="student-class">{student.class}</div>
                        </div>
                    </div>
                )}
           )}
        </div>
        <div className="Infos-container">
        <div className="Infos-data">
            <div className="Photo">
                <div className="Student-photo"></div>
                <div className="add">+</div>
            </div>
            <div className="Student-name">Student name</div>
        </div>
        <Router>
            <div className="Infos-navbar">
                <ul className="Infos-list">
                    <li><Link to="/Details" className="link" /*className={active ? 'ac': false}  onClick={toggleClass}*/ >Details</Link></li>
                    <li><Link to="/Absence" className="link" /*className={active ? 'ac': null}  onClick={toggleClass}*/ >Absence</Link></li>
                    <li><Link to="/Finance" className="link">Finance</Link></li>
                    <li><Link to="/Grades" className="link">Grades</Link></li>
                    <li><Link to="/Exams" className="link">Exams</Link></li>
                    <li><Link to="/Homework" className="link">Homework</Link></li>
                    <li><Link to="/Attitude" className="link">Attitude</Link></li>
                </ul>
            </div>
            <div className="Infos-forms">
                <Switch>
                    <Route path="/Details" component={Details}></Route>
                    <Route path="/Absence" component={Absence}></Route>
                    <Route path="/Finance" component={Finance}></Route>
                    <Route path="/Grades" component={Grades}></Route>
                    <Route path="/Exams" component={Exams}></Route>
                    <Route path="/Homework" component={Homework}></Route>
                    <Route path="/Attitude" component={Attitude}></Route>
                </Switch>
            </div>
        </Router>
    </div>
    </div>
    )
}
